import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { Projects } from "../components/Projects";
import ProjectInfo from "./ProjectInfo.js";

function ProjectsPage() {
  return (
    // <Router>
    <div>
      <h3>Some of the projects I have worked on</h3>
      {Object.values(Projects).map((project, idx) => {
        return (
          <div className="project-gallery">
            <Link to={project.url}>
              <div id={`project-${idx}`} className="project">
                <img className="project-image" src={project.img} alt="" />
                <div className="project-info">
                  {project.name}
                  <p>{project.subTitle}</p>
                </div>
              </div>
            </Link>
          </div>
        );
      })}
      {/* <Routes>
          {Object.values(Projects).map((project, idx) => (
            <Route path={project.path} element={<ProjectInfo />} />
          ))}
        </Routes> */}
    </div>
    // </Router>
  );
}

export default ProjectsPage;
